head.script:
scwin.onpageload = function() {
	dl_result.setJSON(dl_hcode1.getAllJSON());
};

function searchHcode() {
    let keyword = ipt_hcode1.getValue().trim().toUpperCase();

    dl_hcode1.setColumnFilter(
        {
            type: 'row',
            colIndex: 'code',
            key: keyword,
            condition: 'and',
            exactMatch: false
        }
    );

    let result1 = dl_hcode1.getAllFilteredJSON();

    dl_hcode1.setColumnFilter(
        {
            type: 'row',
            colIndex: 'des',
            key: keyword,
            condition: 'or',
            exactMatch: false
        }
    );

    let merged = mergeUniqueRows(result1, dl_hcode1.getAllFilteredJSON());

    dl_result.setJSON(merged);
}

scwin.btn_search_onclick = function (e) {
    searchHcode();
};

scwin.ipt_hcode1_onkeydown = function (e) {
    if (e.key === "Enter") {
        searchHcode();
    } 
};

scwin.btn_confirm_onclick = function (e) {
    $p.parent().ipt_hcode1.setValue(localStorage.getItem("hcode1"));
    localStorage.removeItem("hcode1");
    $p.closePopup();
};

scwin.btn_close_onclick = function (e) {
    localStorage.removeItem("hcode1");
    $p.closePopup();
};

scwin.grd_result_oncellclick = function (rowIndex, columnIndex, columnId) {
    // localStorage에 저장
    localStorage.setItem("hcode1", grd_result.getRowData(rowIndex)[0]);
};
